import React from "react";

function Footer() {
  const handleClick = () => {
    window.open("http://twitter.com/saigowthamr");
  };

  return (
    <footer>
      <div>
        <h2>App</h2>
        <button onClick={handleClick}>Twitter</button>
      </div>
    </footer>
  );
}

export default Footer;
